CREATE DATABASE IF NOT EXISTS omrstatisticsdb;
USE omrstatisticsdb;
DROP TABLE IF EXISTS Polymorphism;
DROP TABLE IF EXISTS Hierarchy;
DROP TABLE IF EXISTS Override;
DROP TABLE IF EXISTS Function;
DROP TABLE IF EXISTS File;
DROP TABLE IF EXISTS Class;
CREATE TABLE File (
	ID INT,
	Location VARCHAR(128),
	PRIMARY KEY(ID)
);
ALTER TABLE File CONVERT TO CHARACTER SET latin1 COLLATE latin1_general_cs;
CREATE TABLE Class (
	ID INT,
	Namespace VARCHAR(49),
	ClassName VARCHAR(59),
	IsExtensible INT,
	PRIMARY KEY(ID),
	UNIQUE (Namespace, ClassName)
);
ALTER TABLE Class CONVERT TO CHARACTER SET latin1 COLLATE latin1_general_cs;
CREATE TABLE Function (
	ID INT,
	FunctionName VARCHAR(64),
	Signature VARCHAR(403),
	ClassID INT,
	IsVirtual INT,
	IsImplicit INT,
	FileID INT,
	PRIMARY KEY(ID),
	FOREIGN KEY(ClassID) REFERENCES Class(ID),
	FOREIGN KEY(FileID) REFERENCES File(ID),
	UNIQUE (Signature, ClassID)
);
ALTER TABLE Function CONVERT TO CHARACTER SET latin1 COLLATE latin1_general_cs;
CREATE TABLE Override (
	BaseFunctionID INT,
	OverridingFunctionID INT,
	PRIMARY KEY(BaseFunctionID, OverridingFunctionID),
	FOREIGN KEY(BaseFunctionID) REFERENCES Function(ID),
	FOREIGN KEY(OverridingFunctionID) REFERENCES Function(ID)
);
ALTER TABLE Override CONVERT TO CHARACTER SET latin1 COLLATE latin1_general_cs;
CREATE TABLE Hierarchy (
	ID INT,
	BaseClassID INT,
	PRIMARY KEY(ID),
	FOREIGN KEY(BaseClassID) REFERENCES Class(ID)
);
ALTER TABLE Hierarchy CONVERT TO CHARACTER SET latin1 COLLATE latin1_general_cs;
CREATE TABLE Polymorphism (
	HierarchyID INT,
	ChildClassID INT,
	ParentClassID INT,
	PRIMARY KEY(HierarchyID, ChildClassID, ParentClassID),
	FOREIGN KEY(HierarchyID) REFERENCES Hierarchy(ID),
	FOREIGN KEY(ParentClassID) REFERENCES Class(ID),
	FOREIGN KEY(ChildClassID) REFERENCES Class(ID)
);
ALTER TABLE Polymorphism CONVERT TO CHARACTER SET latin1 COLLATE latin1_general_cs;
